        "title": "What Exactly is Spacetime? Explained in Ridiculously Simple Words",
        "description": "Spacetime, as a concept, is related to a space that consists of 4 dimensions instead of the regular 3-dimensional space. As early as 1905, Einstein proposed a now widely popular theory that the speed of light is independent of the motion of all observers, and that space and time are interconnected in a single continuum. This theory, which is now a cornerstone of modern and quantum physics, is known as Einstein’s special theory of relativity. Einstein's proposed idea of a single continuum where space and time are interwoven is what people call “space-time”.\nAccording to this theory, time—which has traditionally been considered an independent entity according to the principles of classical physics—is affected when a body moves through space. This happens because, according to the theory, time and space are connected and part of a single continuum—spacetime.\nIn this video, we discuss spacetime in absolutely simple words: what exactly is spacetime and how is it related to the force of gravitation and Einstein’s theory of relativity?\n\n#science #animation #spacetime\n\n\nReferences:\nhttps://asd.gsfc.nasa.gov/blueshift/index.php/2015/11/25/100-years-of-general-relativity/\nhttps://sci.esa.int/web/lisa-pathfinder/-/56434-spacetime-curvature\nhttps://sites.pitt.edu/~jdnorton/teaching/HPS_0410/chapters/Special_relativity_rel_sim/index.html\n\n\nIf you wish to buy/license this video, please write to us at admin@scienceabc.com.\n\nVoice Over Artist: John Staughton ( https://www.fiverr.com/jswildwood )\n\nSUBSCRIBE to get more such science videos! \nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\n\nFollow us on Twitter! \nhttps://twitter.com/abc_science\n\nFollow us on Facebook!\nhttps://facebook.com/sciabc\n\nFollow our Website!\nhttps://www.scienceabc.com",
