        "description": "FOR COPYRIGHT ISSUES CONTACT:Mmarmelonic@gmail.com\n\nBlack Holes might just be one of the most fascinating and mysterious phenomena in the universe. They are massive beasts in terms of powerbut at the same time, virtually invisible to us. But because of the research that was put into them over the last couple of decades, we’ve gone from knowing absolutely nothing about them, to getting to learn more and more, up close and personal. And well, things have just gotten crazier. Michio Kaku just announced that we’ve finally gotten a look at what’s inside a black hole, and this new information brings light to the details the world of science might’ve missed, all along. Join us as we dig deeper into black holes, and unveil what’s inside space’s “big bad.”",
